(54551, 'F2D8A7EF-BF13-45E2-9FC0-F82665935889', 'Ok. Got home safely. Drive wasn’t that big of a deal.  It was interesting for me how not weird the whole thing felt. There were about 18 people there….almost all couples. I was one of the only solo participants. They were all very nice. Did an opening circle (you would have appreciated ice breaker) and there is a dance room and bedroom …. And pretty soon most people start pairing off and having sex. I was with one woman….she kinda picked me out and I went with it. And it was really good fun. It’s pretty simple and not complicated….unlike non-monogamy situations where there is more relationship and connection. This is just sex.  I think most people did 2 and some 3 rounds…but that was a bit much for me.  Very efficient, if that’s your thing!  I’d be curious if you would like it at all. I don’t think any of the people are folks you would deeply mind meld with…so maybe you would need to be very high! It is definitely it’s own scene…and the people are not poly or even date multiple people…they just have sex at parties. ', '682162077098725504', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2022-08-14T02:27:57.098726'),
